import * as React from 'react';
import Box from '@mui/material/Box';
import Card from '@mui/material/Card'
import TextField from '@mui/material/TextField';

export default function PostForm() {
  return (
   
    <Box
      component='form'
      sx={{
        // '& .MuiTextField-root': { m: 1, width: '25ch' },
        width: 500,
        height: 300,
        m: 5
      }}
      noValidate
      autoComplete='off'
    >
      <div>
  
        <TextField id='outlined-Creator-input' label='Creator' />
        <TextField id='outlined-Title-input' label='Title' />
        <TextField id='outlined-Message-input' label='Message' />
        <TextField id='outlined-Tags-input' label='Tags' />
       
      </div>
      <div></div>
    </Box>
  );
}
